  return (
    <div className="App">
      <img className="App-logo " src={kindness} alt="kindness"/>
      <h1>I need an angel</h1>
      <h2>'I need an angel' is a simple tool for people with relatively secure financial statuses to help people who have been affected by the COVID-19 outbreak.<br/> You can </h2>
      <button className="Button">Give</button>
      <button className="Button Button2">Receive</button>
    </div>
  );
}

export default App;
